import React from 'react';

const Home = () => {
  return (
    <div className="container">
      <section className="page-section">
        <h1 className="section-title">Welcome to {process.env.REACT_APP_COMPANY_NAME || 'ConstructionPro'}</h1>
        <div className="section-content">
          <p>Your trusted partner in construction and building solutions.</p>
          <p>We specialize in delivering high-quality construction services with years of expertise and dedication.</p>
        </div>
      </section>
    </div>
  );
};

export default Home;
